import React from 'react'
import { v4 as uuidv4 } from 'uuid';
import { useState,useEffect } from 'react';
import { raiseproblem,add_image } from './utils/ApiRequest';
import { ToastContainer, toast } from 'react-toastify';
import { Form } from 'react-bootstrap';
import '../src/new.css'
import { Link } from 'react-router-dom';
import { Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
function Newgrievance() {
  const [image,setimage]=useState(null);
  const[address,setaddress]=useState("");
  const[department,setdepartment]=useState("");
  const[problem,setproblem]=useState("");
  // console.log(image,name,department,problem);

  function generateToken() {
    return uuidv4();
  }

 const navigate=useNavigate();
  const toastOptions = {
    position: "bottom-right",
    autoClose: 2000,
    hideProgressBar: false,
    closeOnClick: true,
    pauseOnHover: false,
    draggable: true,
    progress: undefined,
    theme: "dark",
  };
  const handleShowLogout = () => {
    localStorage.removeItem("user");
    navigate("/login");
  }

  const handle_submit=async (e)=>{
    e.preventDefault();
    console.log(image);
    const formData = new FormData();
    formData.append('image', image);
    const result = await axios.post(
      add_image,
      formData,
      {
        headers: { "Content-Type": "multipart/form-data" },
      }
    );
    const uniqueToken = generateToken();
    const user = JSON.parse(localStorage.getItem("user"))
    const data=await axios.post(raiseproblem,{
      email: user.email,
      address:address,
      problem:problem,
      department:department,
      token:uniqueToken,
    })
    if (data.data.success === true) {
      window.alert(`You Have raised your Problem and your Token is ${uniqueToken}`);
      window.location.reload()
      toast.success(data.data.message, toastOptions);

    } else {
      toast.error(data.message, toastOptions);
    }
  }
  const reset=(e)=>{
    e.preventDefault();
    setaddress('');
    setdepartment('');
    setproblem('');
    setimage('');
  }
  const onInputChange = (e) => {
    // console.log(e.target.files[0]);
    setimage(e.target.files[0]);
  };
  return (
    <>
    <div class="sidenavbar">
<Link to='/'>Home</Link>
<Link to='/new'>New Grievance</Link>
<Button variant='primary' onClick={handleShowLogout} className="m-3">Logout</Button>
</div>
    <h1 className='text-center'>Raise Your Problem</h1>
    <div className='container-new justify-content-center"'>
       <form className="form-new" method='POST'>
        <label htmlFor="" className='mt-5 h4'>Address</label>
        <input type="text" placeholder='address' value={address} 
                  onChange={(e)=>{setaddress(e.target.value)}}/><br/>
        <label className="h4" htmlFor="">Department</label>
        <select className="m-4" name="" id="" value={department} 
                  onChange={(e)=>{setdepartment(e.target.value)}}>
             <option value="">Choose...</option>
             <option value="PWD">Public Works Department</option>
             <option value="HSD">Health and Sanitation Department</option>
             <option value="TD">Transportation Department</option>
             <option value="EPD">Environmental Protection Department</option>
             <option value="SS">Social Services Department</option>
             <option value="TD">Transportation Department</option>
             <option value="other">Other</option>
        </select><br/>
        <Form.Group controlId="formFile" className="mb-3">
        <Form.Label>Attach Image</Form.Label>
        <Form.Control type="file" accept="image/*" onChange={onInputChange}/>
      </Form.Group>
        <label className='h4' htmlFor="">Problem</label>
        <input type="textarea" placeholder='Problem Description'value={problem} 
                  onChange={(e)=>{setproblem(e.target.value)}}/><br/>
        <button type="submit" className='btn btn-warning ' onClick={handle_submit}>Submit</button>
        <button className='btn btn-success m-3' onClick={reset}>Reset</button>
       </form>
    </div>
    </>
  )
}

export default Newgrievance
